bioghist.p:
In afwijking van de herziening van 1873, die schatting volgens een uniforme grondslag kende, ging de wet van 1897 uit van drie categorieën gebouwde eigendommen, die op verschillende wijze werden geschat: 


boerderijen: 1,5 % van de stichtingskosten;

fabrieken e.d.: 6 % van de verkoopwaarde (jaren 1892-1896);

overige (vnl. woonhuizen): gemiddelde jaarlijkse huurwaarde (jaren 1892-1896).

arrangement.p:
Men kan de Uitkomsten vergelijken met andere bronnen zoals: 


de Oorspronkelijk Aanwijzende Tafels van 1832 (in archief Inspecteur van het Kadaster; microfiches van de OAT en van de bijbehorende minuutplans berusten op de afdeling Kaarten en Tekeningen). Men kan aldus nagaan welke wijzigingen zich voordeden bij het gebruik, de verkaveling, de belastbare opbrengst e.d.

de kadastrale legger: de kolommen 1 en/of 2 van de Uitkomsten verwijzen naar het artikelnummer in de kadastrale legger; in de legger wordt onder dit nummer een overzicht gegeven van alle eigendommen van een bepaalde eigenaar in een kadastrale gemeente (de leggers berusten bij de Dienst van het KADOR);

het Bevolkingsregister: in de Uitkomsten van 1873 (kolom 7) en die van 1897 (kolom 8)" wordt verwezen naar straat- of wijknummer, aan de hand waarvan gezocht kan worden in het Bevolkingsregister, dat meestal ook per straat of wijk is ingericht (de bevolkingsregisters berusten in de gemeentearchieven);

de kohieren van de hoofdelijke omslag, een plaatselijke belasting op het inkomen maar ook wel met de huurwaarde van de huizen als grondslag (de kohieren berusten eveneens in de gemeentearchieven).

M.M.Klep e.a.. De kohieren van de gemeentelijke hoofdelijke omslag, Bronnencommentaar II (Hilversum 1987).

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
